import React from 'react';

const CommentCard = (comment) => {
  return (
    <div>
      <li>
      <h3>
          {comment.title}
        </h3>
        <h4>
          by: <Link to= {myLink}> {comment.author}</Link>
          <br/>
          in: {comment.topic}
        </h4>
        <h5>
          published at: {comment.created_at}
        </h5>

      </li>
    </div>
  );
};

export default CommentCard;
